function Persion(e,t){this.name=e,this.age=t}Array.prototype.unique1=function(){for(var e=[this[0]],t=1;t<this.length;t++){for(var i=!1,n=0;n<e.length;n++)if(this[t]==e[n]){i=!0;break}i||e.push(this[t])}return e};var arr=[1,"a","a","b","d","e","e",1,0];alert(arr.unique1());var objectList=new Array;objectList.push(new Persion("jack",20)),objectList.push(new Persion("tony",25)),objectList.push(new Persion("stone",26)),objectList.push(new Persion("mandy",23)),objectList.sort(function(e,t){return e.age-t.age});for(var i=0;i<objectList.length;i++)document.writeln("<br />age:"+objectList[i].age+" name:"+objectList[i].name);